import React from "react";
import styled from "styled-components";
import img from "../canes.png";

const HeaderImg = styled.div.attrs({
  className: "absolute top-0 right-0 block w-9/12 h-full",
})``;

const HeaderDiv = styled.div.attrs({
  className: "relative h-64 m-8 overflow-hidden rounded-lg",
})``;

export default function Header() {
  return (
    <HeaderDiv>
      <HeaderImg>
        <img
          src={img}
          alt="Header image"
          className="absolute-cover min-w-full h-full"
        />
      </HeaderImg>
    </HeaderDiv>
  );
}
